function CreateContact(props){
    return(
    <div class = "CreateContact">
        <h3>{props.name}</h3>
        Type: <input type ="text" id = "type"/>
        Number:  <input type = "text" id = "number" />
        <button id = "add_number" class = "button1">Add</button>
        <Table /> 
        <br/>
        <button id = "dl" class = "button2">Delete</button> 

    </div>
    );
  }

export default CreateContact;
